import React from 'react';

const Dropdown = (props) => {
  return (
    <>
      <select>
        {props.options.map((item, idx) => (
          <option key={idx} value={item.value}>
            {item.name}
          </option>
        ))}
      </select>
    </>
  );
};

export default Dropdown;
